import './Project.css';
import Icon from './Bumo.io.png';

function Project(props) {
    const tags = ["WebSockets", "Physics", "javascript", "Node.js"]
    const tagItems = tags.map(tag => <li key={tag}>{tag}</li>)
    return (
        <div className="Project">
            <img src={Icon} className="ProjectIcon"></img>
            <div className="ProjectDescription">
                <h2>Bumo.io</h2>
                <ul>{tagItems}</ul>
                <p>Project descript loreum sjaisdkjakj sjdkajsd  sajdja sjoasd</p>
                <button className="RepoButton">Visit Repo</button>
            </div>
        </div>
    );
}

export default Project;
